INSERT INTO `comp_info_certi` VALUES ('3', '2018-05-27 16:49:01', '2018-05-27 16:50:49', '3', '墨铭文化传播有限公司', '', '2017-08-10 00:00:00', '0-50', '民营', '商业/销售/促销', '江苏省', '苏州市', '张家港市 古北路628号', '上海墨铭文化传播有限公司（易兼职）是一家专注于为广大青年群体提供优质兼职的公司，公司涉猎会展，促销，推广，客服等行业，让各位彻底告别黑中介，人贩子。公司成立于2016年10月19日，公司位于上海市松江区新浜镇新绿路398号', '3\\630b78499c924794a465e1d49b9b74b3.jpg', '程鑫', '182522255123', '1515616516@aa.com', '2');
INSERT INTO `comp_info_certi` VALUES ('4', '2018-05-27 18:40:07', '2018-05-27 18:40:07', '4', '苏州璧合数据科技有限公司', 'http://behe.com/about/', '2012-05-15 00:00:00', '50-150', '民营', '计算机/网络', '江苏省', '苏州市', '高新区 滨河路金狮大厦', '璧合科技是国内第一家登陆新三板的DSP公司，为企业提供数字营销技术解决方案和精准营销服务。凭借强大的数据应用能力和广告优化能力，致力构建满足营销需求的全链条生态体系，成为数字营销领域的引擎。', '4\\d2138b6c469946c1a42c4d3d2e83b65d.jpg', '撒打算', '185225525522', '18135516@qq.com', '2');
INSERT INTO `comp_job_info` VALUES ('1', '2018-05-27 16:28:18', '2018-05-27 16:28:18', '1', '餐厅工作', '江苏省 苏州市 张家港市 世纪大道1589号长泰国际金融大厦1楼07单元', '20.00', '小时', '月结', '星巴克兼职招聘', '全日制大专以上在校学生，每月可以提供80小时工时，可以适应轮班制工作方式，17.5元每小时. 福利：工作满4小时可享受一杯含咖啡饮料，工作满三个月每月享受10张饮料电子券，享受门市福利品发放.\n不招暑期工，谢谢！', '全日制大专以上在校学生', '12', '店经理', '58309068', '0', '10');
INSERT INTO `comp_job_info` VALUES ('2', '2018-05-27 16:30:22', '2018-05-27 16:30:22', '1', '餐厅工作', '江苏省 苏州市 张家港市 七莘路-地铁站', '22.00', '小时', '月结', '急招服务员包吃住', '1，主动热情的为客户提供加油收银服务；\n2，做好加油站的安全，卫生工作；\n3，做好便利店的销售工作；\n4，完成上级处置的其他任务；', '1，男女不限，年龄38周岁以内，身体健康，初中以上文化；\n2，为人诚实，有一定的服务意识，服从安排，责任心强，无不良社会记录；\n3，有加油站工作经验优先，需上晚班；', '20', '李小姐', '1825526525', '0', '7');
INSERT INTO `comp_job_info` VALUES ('3', '2018-05-27 16:32:26', '2018-05-27 16:32:26', '1', '超/便利店小时工', '江苏省 苏州市 张家港市 阿斯达所阿斯达阿斯达', '200.00', '天', '当日结', '每日优鲜补货员', '补货', '18-43岁 男女不限 初中及以上学历【上班时间】早上8：00-21：00 做六休一', '0', '王小姐', '13381722795', '0', '9');
INSERT INTO `comp_job_info` VALUES ('4', '2018-05-27 16:34:17', '2018-05-27 16:34:17', '1', '超/便利店小时工', '江苏省 苏州市 张家港市 阿萨斯阿萨斯', '220.00', '天', '月结', '麦德龙打包分拣', '负责所有与顾客订单相关的活动。整理货物', '开始日期：\n2017年12月20日\n \n白班:\n05:00-16:0012:00-23:00\n结束日期：\n2018年12月19日', '40', '李先生', '151418516', '0', '0');
INSERT INTO `comp_job_info` VALUES ('5', '2018-05-27 16:37:07', '2018-05-27 16:37:07', '1', '递送/快递员', '江苏省 苏州市 张家港市 撒旦收到啦时间到了', '215.00', '天', '月结', '便利蜂全职，自带车配送员', '根据订单及时安全将货物送到指定地点，并将产品按要求摆放到货架中；\n2、货物按照要求标准进行摆放、陈列、上架整理；\n3、及时反馈订单的异常状况，做好订单交接工作；\n4、提供高质量的送货服务，保护货物不受损坏、不丢失；\n5、负责为客户配送休闲食品，熟悉成都市区郊区路线；\n6、负责落实好公司规定的各项服务措施，树立良好的服务形象；爱岗敬业，礼貌待客', '自带车300/月补贴，6个月', '20', '阿斯达所', '148156851', '0', '0');
INSERT INTO `comp_job_info` VALUES ('6', '2018-05-27 16:44:13', '2018-05-27 16:44:13', '2', '游戏测试/试玩/代练', '江苏省 苏州市 张家港市 打手拉手', '123.00', '天', '当日结', '游戏代练代打', '项目一：手游主要经营王者荣耀、球球大作战、热血传奇等。\n网游主要经营LOL、CF、DNF、魔兽世界、梦幻西游、QQ飞车、逆战、剑灵、守望先锋、梦三国、神武、问道、大话西游、天涯明月刀、征途、新天龙八部、魔域、Dota2等。\n薪资待遇：一部手机约25元一小时，多部手机或者多台电脑，收入倍增', '随教随会，不限地点，手机，电脑，平板，都可完成操作。\n学历不限，学生 宝妈 上班族皆宜 每日工作3个小时 在家就可日赚100-500元，当天结算。', '33', '阿斯达所', '231231231212', '0', '0');
INSERT INTO `comp_job_info` VALUES ('7', '2018-05-27 16:45:32', '2018-05-27 16:45:32', '2', '餐厅工作', '江苏省 苏州市 张家港市 萨姆大搜的安师大', '220.00', '天', '月结', '饮品培训师', '1.具备相关饮品培训和工作经验，对水吧调试制作有相当浓厚的兴趣；\n2.能够独立进行咖啡、饮品、奶茶技术研发，产品制作指导。\n3.负责公司各类新饮品的前期研发、制作、调试。\n4.了解饮品机器设备的相关原理，维护保养方法等，具有一定的知识技能传授能力。\n5.具备敏锐的饮品业新趋势，能从国内及国外饮品行业的角度对国内进行准确分析，根据消费者需求进行产品升级和新品研发。\n6、有食品/饮品相关专业资格证书', '1.中专及以上学历，食品及相关专业（有2年以上相关研发经验）优先，有类似经验或有能力者兼可；\n2.负责公司新产品（饮品）的研发和培训工作；\n3、负责公司技术团队的研发及管理工作；\n4、对奶茶、果汁、咖啡等有一定的了解，熟悉市场的需求和大众口味，熟悉相关供应商；喜欢尝试新口味，有创新思维；\n5、能根据营销计划制定年度新品研发计划；及进行新品制作培训；\n6、熟悉产品制作相关设备的使用与维护；熟悉相关材料特性,进行产品研发成本及效果分析；', '22', '萨达', '15853161568156', '0', '0');
